"        const getCircularReplacer = () => {
          const seen = new WeakSet()
          return (key, value) => {
            if (typeof value === "object" && value !== null) {
              if (seen.has(value)) {
                return
              }
              seen.add(value)
            }
            return value
          }
        }

        (function(){
          var _log = console.log;
          var _info = console.info;
          var _error = console.error;
          var _warning = console.warning;

          console.error = function(...argumentArray){
              let data = {
                  "type": "error",
                  "data": JSON.stringify(argumentArray, getCircularReplacer())
              };
              window.webkit.messageHandlers.consoleLog.postMessage(JSON.stringify(data))
             _error.apply(console,argumentArray);
          };

          console.log = function(...argumentArray){
              let data = {
                  "type": "log",
                  "data": JSON.stringify(argumentArray, getCircularReplacer())
              };
              window.webkit.messageHandlers.consoleLog.postMessage(JSON.stringify(data))
              _log.apply(console,argumentArray);
          };

          console.info = function(...argumentArray){
              let data = {
                  "type": "info",
                  "data": JSON.stringify(argumentArray, getCircularReplacer())
              };
              window.webkit.messageHandlers.consoleLog.postMessage(JSON.stringify(data))
              _info.apply(console,argumentArray);
          };

          console.warning = function(...argumentArray){
              let data = {
                  "type": "warning",
                  "data": JSON.stringify(argumentArray, getCircularReplacer())
              };
              window.webkit.messageHandlers.consoleLog.postMessage(JSON.stringify(data))
             _warning.apply(console,argumentArray);
          };

          window.onerror = function (message, file, line, col, error) {
              let data = {
                  "type": "onerror",
                  "data": JSON.stringify(arguments, getCircularReplacer())
              };
             window.webkit.messageHandlers.consoleLog.postMessage(JSON.stringify(data))
             return false;
          };
          window.addEventListener("error", function (e) {
              let data = {
                  "type": "errorevent",
                  "data": JSON.stringify(arguments, getCircularReplacer())
              };
             return false;
          })

        })();"
